Transformers Prime Beast Hunters: Predacons Rising (2013) (BRRip - MP4)
-----------------------------------------------------------------------

A resurrected UNICRON has taken over the now-lifeless body of MEGATRON
to seek vengeance on the AUTOBOTS and ultimately, the destruction of
Cybertron. This formidable enemy forces an unlikely alliance between
the AUTOBOTS, DECEPTICONS, PREDAKING and two new Predacons, who come
together in an epic battle to help protect their newly restored planet!

Produced by Polygon Pictures and Hasbro Studios.

Cast: Peter Cullen, John Noble, Will Friedle, Nolan North, Kevin Michael Richardson,
      Josh Keaton, Sumalee Montano, Jeffrey Combs, Peter Mensah and Frank Welker.

Producers: Jeff Kline, Roberto Orci and Alex Kurtzman.

Writers: Duane Capizzi, Marsha Griffin and Steven Melching.

Directors: Vinton Heuck, Scooter Tidwell and Todd Waterman.

